import React from 'react';

function List() {
  return (
    <div>
      <header className="App-header">
        <Grid
          columns={2}
          centered
          textAlign="center"
          divided
          relaxed
          style={{ height: '100vh' }}
        >
          <GridColumn verticalAlign="middle">
            <p>Welcome to the Ultimate Skribbl.io Experience</p>
          </GridColumn>

          <GridColumn verticalAlign="middle">
            <Button primary> Click here to get started </Button>
          </GridColumn>
        </Grid>
      </header>
    </div>
  );
}

export default List();
